import React from 'react';
import Paper from "@material-ui/core/Paper";
import { Match } from "@reach/router";


function Question(props) {




    return(
        <Match path="question/:questionId">
  {props => (
    <div>
      {props.match
        ? "No match"
        : props.match.id}
    </div>
  )}
</Match>   
    )
}

export default Question;
